import './Home.css';
import repDir from '../../repGood.json'


function Home() {
  // console.log(repDir);
  // for (let i=0; i < repDir.length; i++) {
  //   console.log(repDir[i].songTitle);
  // }
  return (
    <div className="home">
      <div className="parent">
        <div className="div1">
          <p>
            Showing <em>400</em> of <em>405</em> songs in the collection.
          </p>
        </div>
        <div className="div2">
          {' '}
          <p>search by title</p>
        </div>
        <div className="div3">
          <p>title | recording | game | add to list</p>
        </div>
        <div className="div4">
          <p>refine search</p>
          <p>reset</p>
          <select>
            <option value="option1">Ethnic Origin</option>
          </select>
          <select>
            <option value="option2">Melodic Element</option>
          </select>
          <select>
            <option value="option3">Rhythmic ELement</option>
          </select>
          <select>
            <option value="option4">Scale</option>
          </select>

        </div>
        <div className="div5">


        <ul className='titleList'>
          {repDir.map((song) => (
            <p>{song.songTitle}</p>
            ))}
        </ul>
            </div>

      </div>
    </div>
  );
}

export default Home;
